INSERT INTO obo_checklist_master (objid, doctypeid, indexno, title, category, params) VALUES ('hw13', 'HOT_WORKS', '13', 'Enclosed equipment cleaned of all combustibles', 'WORK ON WALLS OR CEILINGS/ENCLOSED EQUIPMENT', null);
