INSERT INTO sys_email_template (objid, subject, message) VALUES ('building_permit_assessment', 'Order of Payment for Building Permit App No ${appno}', 'Dear ${contact.name}, <br>\n<br>\nThis has reference to your application for Building Permit with our office. <br>\n<br>\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, \nthrough our cashier or online payment in the City''s website, for us to continue with the processing and \napproval of your application. Use the ff appno as reference for payment<br>\n<h1>${appno}<h1>\n<br>\n<br>\nThank you. <br>\n<br>\n<br>');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('building_permit_claimstub', 'Building Application Claim Stub for ${appno}', 'Dear ${contact.name}, <br>\n\nCongratulations! Your application was accepted. We will now proceed with the evaluation process. \nFor reference your application number is \n\n<h2>${appno}</h2>\n\nPlease use this number to follow up on the progress of your application. \n <br>\n<br>\n\nRegards, <br>\n');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('building_requirement_transmittal', 'Requirements for ${trackingno}', 'Dear ${contact.name}, <br>\n\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. \nPlease see attached for the details. \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n\n');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('occupancy_finding_transmittal', 'Occupancy Inspection Findings for App no ${appno}', 'Dear ${contact.name}, <br>\n\nWe have checked through your evaluation and it seems you have deficiencies in your design.  \n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('occupancy_permit', 'Occupancy Permit No ${controlno}', 'Dear valued client,<br>\n\nYour occupancy permit has been approved. Please review the documents sent. <br>\n\n<br>\nSincerely,\n\n');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('occupancy_permit_assessment', 'Order of Payment for Occupancy Permit App No ${appno}', 'Dear ${contact.name}, <br>\n<br>\nThis has reference to your application for Occupancy Permit with our office. <br>\n<br>\nRelative thereto, attached is a copy of the Order of Payment for said application. Kindly pay the necessary fees, \nthrough our cashier or online payment in the City''s website, for us to continue with the processing and \napproval of your application. Use the ff appno as reference for payment<br>\n<h1>${appno}</h1>\n<br>\n<br>\nThank you. <br>\n<br>\n<br>');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('occupancy_permit_claimstub', 'Occupancy Permit Claim Stub for ${appno}', 'Dear ${contact.name}, <br>\n\nCongratulations! Your application was accepted. We will now proceed with the evaluation process. \nFor reference your application number is \n\n<h2>${appno}</h2>\n\nPlease use this number to follow up on the progress of your application. \n <br>\n\nRegards, <br>\n');
INSERT INTO sys_email_template (objid, subject, message) VALUES ('occupancy_requirement_transmittal', 'Requirements for Occupancy Permit ${trackingno}', 'Dear ${contact.name}, <br>\n\nWe have checked through your requirements and it seems you have deficiencies in the sent requirements. Please see \nattached for the details. <br>\n\nAccomplish them and send them back to the OBO Office. <br>\n\nRegards, <br>\n');
