INSERT INTO sys_rule_deployed (objid, ruletext) VALUES ('RUL-108b4192:15b3d234d5c:-72b4', '\npackage oboassessment.MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE;\nimport oboassessment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE\"\n  agenda-group \"compute-mechanical-fee\"\n salience 50000\n  no-loop\n when\n    \n    \n    BILLITEM: treasury.facts.BillItem (  billcode matches \"MECHANICAL_FEE\" ) \n   \n     obo.facts.OboDecimalInfo (  name matches \"ENGINE_NON_LTO\",KW:value ) \n    \n  then\n    Map bindings = new HashMap();\n   \n    bindings.put(\"BILLITEM\", BILLITEM );\n    \n    bindings.put(\"KW\", KW );\n    \n  RangeEntry re0 = new RangeEntry(\"MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE\");\nre0.setBindings(bindings);\nre0.setDecimalvalue(KW);\nre0.getParams().put( \"billitem\", BILLITEM );\nre0.getParams().put( \"type\", \"ADD\" );\nre0.getParams().put( \"amount\", 0.0 );\ninsert(re0);\n\nend\n\n\n \nrule \"update-billitem-amount_0_0\"\n agenda-group \"compute-mechanical-fee\"\n salience 50000\n  no-loop\n when\n    \n    \n    \n    rv: RangeEntry( id==\"MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE\", decimalvalue <= 50.00 )\n   \n  then\n    Map bindings = rv.getBindings();\n    Map params = rv.getParams();\n    params.put( \"amount\", (new ActionExpression(\"KW * 10\", bindings)) );  \n     \n   action.execute( \"update-billitem-amount\",params, drools);\nend\n\n\n  \nrule \"update-billitem-amount_0_1\"\n agenda-group \"compute-mechanical-fee\"\n salience 50000\n  no-loop\n when\n    \n    rv: RangeEntry( id==\"MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE\", decimalvalue > 50.00, decimalvalue <= 100.00 )\n    \n    \n    \n  then\n    Map bindings = rv.getBindings();\n    Map params = rv.getParams();\n    params.put( \"amount\", (new ActionExpression(\"500 + ((KW-50)*12)\", bindings)) ); \n     \n   action.execute( \"update-billitem-amount\",params, drools);\nend\n\n\n  \nrule \"update-billitem-amount_0_2\"\n agenda-group \"compute-mechanical-fee\"\n salience 50000\n  no-loop\n when\n    \n    \n    rv: RangeEntry( id==\"MECHANICAL_FEE_OTHER_COMBUSTION_ENGINE\", decimalvalue > 100.00 )\n   \n    \n  then\n    Map bindings = rv.getBindings();\n    Map params = rv.getParams();\n    params.put( \"amount\", (new ActionExpression(\"1100 + ((KW-100)*3)\", bindings)) );  \n     \n   action.execute( \"update-billitem-amount\",params, drools);\nend\n\n\n  ');
